	add("hyperentanglement", "{\"term\":\"hyperentanglement\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|hyper|entanglement|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"entanglement involving more than one degree of freedom\", \"priority\":1}]}, \"synonyms\":{}}");

	add("hyperepidemic", "{\"term\":\"hyperepidemic\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|hyper|epidemic|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A very widespread epidemic\", \"priority\":1}]}, \"synonyms\":{}}");

	add("hypereutrophy", "{\"term\":\"hypereutrophy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{prefix|hyper|eutrophy|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the quality of being extremely rich in nutrients and minerals\", \"priority\":1}]}, \"synonyms\":{}}");

	add("hyperfactorial", "{\"term\":\"hyperfactorial\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The result of multiplying a given number of consecutive integers from 1 to the given number, each raised to its own power. \u0026lt;br\u0026gt;For example, the hyperfactorial of 3 is 1\u0026lt;sup\u0026gt;1\u0026lt;/sup\u0026gt; * 2\u0026lt;sup\u0026gt;2\u0026lt;/sup\u0026gt; * 3\u0026lt;sup\u0026gt;3\u0026lt;/sup\u0026gt; \u003d 1 * 4 * 27 \u003d 108\", \"priority\":1}]}, \"synonyms\":{}}");

	add("hyperferremia", "{\"term\":\"hyperferremia\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|hyper|ferrous|emia|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The medical condition of having too much iron in the body\", \"priority\":1}]}, \"synonyms\":{}}");

	add("hyperferritinemia", "{\"term\":\"hyperferritinemia\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{prefix|hyper|ferritinemia|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The presence of an unusually large amount of ferritin in the blood\", \"priority\":1}]}, \"synonyms\":{}}");

	add("hyperfiltration", "{\"term\":\"hyperfiltration\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|hyper|filtration|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An elevation of the rate of glomerular filtration of the kidneys\", \"priority\":1}]}, \"synonyms\":{}}");

	add("hyperfullerene", "{\"term\":\"hyperfullerene\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|hyper|fullerene|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An allotropic form of carbon consisting of one (or more) fullerene molecules inside another\", \"priority\":1}]}, \"synonyms\":{}}");

	add("hyperfunction", "{\"term\":\"hyperfunction\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|hyper|function|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A generalization of a functio\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Abnormally elevated functio\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, \u0027Professional Guide to Pathophysiology\u0027, Lippincott, Williams, \u0026amp; Wilkins, page 2\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Manifestations of disease may include hypofunction (such as constipation), \u0027\u0027hyperfunction\u0027\u0027 (such as increased mucus production), or increased mechanical function (such as a seizure\", \"priority\":4}]}, \"synonyms\":{}}");

	add("hyperfusion", "{\"term\":\"hyperfusion\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Increased perfusion of blood through an organ\", \"priority\":1}]}, \"synonyms\":{}}");

	add("hypergamy", "{\"term\":\"hypergamy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{confix|hyper|gamy|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Act or practice of seeking a spouse of higher socioeconomic status, or caste status than oneself\", \"priority\":1}]}, \"synonyms\":{}}");

	add("hyperglobalism", "{\"term\":\"hyperglobalism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The belief that globalism has led to a situation where individual nation-states are of relatively little power and significance\", \"priority\":1}]}, \"synonyms\":{}}");

	add("hypergraph", "{\"term\":\"hypergraph\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|hyper|graph|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A generalization of a graph, in which edges can connect any number of vertices\", \"priority\":1}]}, \"synonyms\":{}}");

	add("hypergraphia", "{\"term\":\"hypergraphia\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A behavioural condition characterised by an intense desire to write, associated with changes in the temporal lobes due to epilepsy or chemical changes\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1994\u0027\u0027, Thomas J. Csordas, \u002712: Words from the Holy People: a case study in cultural phenomenology\u0027, Thomas J. Csordas (editor), \u0027Embodiment and Experience: The Existential Ground of Culture and Self\u0027, [http://books.google.com.au/books?id\u003d24TAxcRJESQC\u0026amp;pg\u003dPA280\u0026amp;dq\u003d%22hypergraphia%22%7C%22hypergraphias%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dgXtsU9OpONGkkgX-iIGgCw\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22hypergraphia%22%7C%22hypergraphias%22\u0026amp;f\u003dfalse page 280\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Two features of the interictal behavior syndrome are relevant: \u0027\u0027hypergraphia\u0027\u0027 or the tendency to write compulsively and often repetitively, and verbosity or loquaciousness, the tendency to be overly talkative, rambling, and circumstantial in speech\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1996\u0027\u0027, Michael R. Trimble, \u0027Biological Psychiatry\u0027, [http://books.google.com.au/books?id\u003dKLxGkQsXOjoC\u0026amp;pg\u003dPA279\u0026amp;dq\u003d%22hypergraphia%22%7C%22hypergraphias%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dgXtsU9OpONGkkgX-iIGgCw\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22hypergraphia%22%7C%22hypergraphias%22\u0026amp;f\u003dfalse page 279\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"There is some suggestion that \u0027\u0027hypergraphia\u0027\u0027 is associated with non-dominant hemisphere temporal lobe disturbances (Trimble, 1986c\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Joseph M. Tonkonogy, Antonio E. Puente, \u0027Localization of Clinical Syndromes in Neuropsychology and Neuroscience\u0027, [http://books.google.com.au/books?id\u003dt2Y4gv9d3l0C\u0026amp;pg\u003dPA559\u0026amp;dq\u003d%22hypergraphia%22%7C%22hypergraphias%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dgXtsU9OpONGkkgX-iIGgCw\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22hypergraphia%22%7C%22hypergraphias%22\u0026amp;f\u003dfalse page 559\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Two cases of mania and \u0027\u0027hypergraphia\u0027\u0027 in patients with temporal lobe epilepsy were reported by Sanders and Mathews (1994). In the first case, a 58-year-old right-handed man suffered a ruptured right middle cerebral artery aneurism, which required a craniotomy. During interictal periods, the patient demonstrated \u0027\u0027hypergraphia\u0027\u0027, as well as several episodes of alternating manic and mildly depressive phases\", \"priority\":10}]}, \"synonyms\":{}}");

	add("hypergraphy", "{\"term\":\"hypergraphy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|hyper|graphy|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A key method of Lettrism that merges poetry with visual arts\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1983\u0027\u0027, University of Iowa Museum of Art, \u0027Lettrisme: into the present\u0027, [http://books.google.com.au/books?id\u003dvds3AQAAIAAJ\u0026amp;q\u003d%22hypergraphy%22\u0026amp;dq\u003d%22hypergraphy%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dGL1sU_ehAsfdkAWB1YGwCQ\u0026amp;redir_esc\u003dy page 32\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The paradigm had been different for artists such as Picasso and Braque, Paul Klee and Mark Tobey who had used writing, letters, signs, and symbols before \u0027\u0027hypergraphy\u0027\u0027; their works were seen as figurative or non-figurative\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1984\u0027\u0027, Association internationale d\u0027etudes du Sud-Est europeen, \u0027Papers for the V. Congress of Southeast European Studies\u0027, [http://books.google.com.au/books?id\u003dEElpAAAAMAAJ\u0026amp;q\u003d%22hypergraphy%22\u0026amp;dq\u003d%22hypergraphy%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dGL1sU_ehAsfdkAWB1YGwCQ\u0026amp;redir_esc\u003dy page 142\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Isou has also explored the domain of the novel into which he has introduced \u0027\u0027hypergraphy\u0027\u0027.\u0026lt;sup\u0026gt;12\u0026lt;/sup\u0026gt; His first novel, \u0027Les journaux des Dieux\u0027, is essentially visual: words are replaced by images\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, Steve McCaffery, \u0027Prior to Meaning: The Protosemantic and Poetics\u0027, [http://books.google.com.au/books?id\u003d0NKbcNnqwRkC\u0026amp;pg\u003dPA171\u0026amp;dq\u003d%22hypergraphy%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dGL1sU_ehAsfdkAWB1YGwCQ\u0026amp;redir_esc\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22hypergraphy%22\u0026amp;f\u003dfalse page 171\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Isou and Lemaitre further introduced scriptural systems (metagraphics, or postwriting, and \u0027\u0027hypergraphy\u0027\u0027, respectively) that fetishize the graphic as irreducible to vocalization\", \"priority\":8}]}, \"synonyms\":{}}");

	add("hypergravity", "{\"term\":\"hypergravity\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{prefix|hyper|gravity|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The presence of an apparently increased gravitational field in an accelerating or rotating situation\", \"priority\":1}]}, \"synonyms\":{}}");

	add("hyperhalophile", "{\"term\":\"hyperhalophile\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{prefix|hyper|halophile|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A halophile that can survive in extremely salty environments\", \"priority\":1}]}, \"synonyms\":{}}");

	add("hyperhidrosis", "{\"term\":\"hyperhidrosis\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From {{prefix|hyper-||lang\u003den}} Ancient greek (to 1453) {{m|grc|ἱδρώς||sweat}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A medical condition with the primary symptom of excessive sweating, in excess of that required for regulation of body temperature\", \"priority\":1}]}, \"synonyms\":{}}");

	add("hyperinflation", "{\"term\":\"hyperinflation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{wikipedia}}{{prefix|hyper|inflation|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A very high rate of Inflation\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1985\u0027\u0027, Leon N. Lindberg, Charles S. Maier, Brian M. Barry, \u0027The Politics of inflation and economic stagnation\u0027, page 7\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Even though ten years elapsed between the German \u0027\u0027hyperinflation\u0027\u0027 of 1923 and the seizure of power by Hitler, it is often suggested that the two events are causally related\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1987\u0027\u0027, Philip Cagan, \u0026quot;Hyperinflation\u0026quot;, in \u0027The New Palgrave: A Dictionary of Economics\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Only inconvertible paper currencies can be expanded rapidly without limit to generate \u0027\u0027hyperinflation\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, John Barkley Rosser, Marina V. Rosser, \u0027Comparative Economics in a Transforming World Economy\u0027, page 23\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"When \u0027\u0027hyperinflation\u0027\u0027 peaked, wheelbarrows full of money were required to shop for groceries\", \"priority\":7}]}, \"synonyms\":{}}");

	add("hyperinsulinaemia", "{\"term\":\"hyperinsulinaemia\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|hyper|insulinaemia|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The presence of an unusually high level of insulin in the bloodstream\", \"priority\":1}]}, \"synonyms\":{}}");

	add("hyperinsulinemia", "{\"term\":\"hyperinsulinemia\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|hyper|insulinemia|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The condition of having an excessively high level of insulin in the blood, usually due to excess production\", \"priority\":1}]}, \"synonyms\":{}}");

	add("hyperion", "{\"term\":\"hyperion\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027ὑπερίων\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A Titan, the son of Gaia and Uranus and the father of Helios, Selene and Eos\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"One of the moons of Saturn\", \"priority\":2}]}, \"synonyms\":{}}");

	add("hyperkalemia", "{\"term\":\"hyperkalemia\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|hyper|kalemia|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The condition of having an abnormally high concentration of potassium ions in the blood\", \"priority\":1}]}, \"synonyms\":{}}");

	add("hyperkeratosis", "{\"term\":\"hyperkeratosis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|hyper|keratosis|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Excess keratin formation on the skin surface, as can be seen in a number of dermatologic conditions\", \"priority\":1}]}, \"synonyms\":{}}");

	add("hyperkinesis", "{\"term\":\"hyperkinesis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|hyper|kinesis|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Abnormally increased and sometimes uncontrollable activity or muscular movements\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A condition especially of childhood characterized by hyperactivity\", \"priority\":2}]}, \"synonyms\":{}}");

	add("hyperkyphosis", "{\"term\":\"hyperkyphosis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|hyper|kyphosis|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"excessive kyphotic curvature of the thoracic region of the spine\", \"priority\":1}]}, \"synonyms\":{}}");

	add("hyperlexia", "{\"term\":\"hyperlexia\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"* From \u0027\u0027 + \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The precocious ability to read single words at a very early age\", \"priority\":1}]}, \"synonyms\":{}}");

	add("hyperlink", "{\"term\":\"hyperlink\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|hyper|link|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Some text or a graphic in an electronic document that can be activated to display another document or trigger an action\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An address, URL, or program that defines a hyperlink\u0027s function\", \"priority\":2}]}, \"synonyms\":{}}");

	add("hypermasculinity", "{\"term\":\"hypermasculinity\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{prefix|hyper|masculinity|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality or exhibition of exaggerated masculine behavior or traits, especially strength and those of a violent, dominant, or sexual natur\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, Varda Burstyn, \u0027The rites of men: manhood, politics, and the culture of sport\u0027, page 192\u0026lt;!---[http://books.google.com/books?id\u003dVys1oqERxbIC\u0026amp;pg\u003dPA192\u0026amp;dq\u003dhypermasculinity\u0026amp;hl\u003den\u0026amp;ei\u003djuqfTp2KCqqoiAKMor1g\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d3\u0026amp;sqi\u003d2\u0026amp;ved\u003d0CDYQ6AEwAg]---\u0026gt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"These images glamourized and normalized violent standards of \u0027\u0027hypermasculinity\", \"priority\":3}]}, \"synonyms\":{}}");

	add("hypermedia", "{\"term\":\"hypermedia\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The use of text, data, graphics, audio and video as elements of an extended hypertext system in which all elements are linked so that the user can move among them at will\", \"priority\":1}]}, \"synonyms\":{}}");

	add("hypermetabolism", "{\"term\":\"hypermetabolism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|hyper|metabolism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The physiological state of increased metabolic activity, typically occurring after significant damage to the body\", \"priority\":1}]}, \"synonyms\":{}}");

	add("hypermethylation", "{\"term\":\"hypermethylation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"an increase in the epigenetic methylation of cytosine and adenosine residues in DNA\", \"priority\":1}]}, \"synonyms\":{}}");

	add("hypermetropia", "{\"term\":\"hypermetropia\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027ὑπέρμετρος\u0027 (excessive) + \u0027ὀπός\u0027 (genitive of \u0027ὄψ\u0027 (eye) {{suffix||ia|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"hyperopia\", \"priority\":1}]}, \"synonyms\":{}}");

	add("hypermodernism", "{\"term\":\"hypermodernism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or condition of being hypermodern\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An art movement distinguished from modernism and postmodernism chiefly by its extreme and antithetical approach\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A school of thought which advocates controlling the centre of the board with distant pieces rather than with pawns, thus inviting the opponent to occupy the centre with pawns which can then become objects of attack\", \"priority\":3}]}, \"synonyms\":{}}");

	add("hypermyelination", "{\"term\":\"hypermyelination\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|hyper|myelination|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Excessive myelination\", \"priority\":1}]}, \"synonyms\":{}}");

	add("hypernationalism", "{\"term\":\"hypernationalism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|hyper|nationalism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Extreme nationalism, the belief in the superiority of one\u0027s nation and of the paramount importance of advancing it\", \"priority\":1}]}, \"synonyms\":{}}");

	add("hypernatremia", "{\"term\":\"hypernatremia\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An abnormally high concentration of sodium (or salt) in blood plasma\", \"priority\":1}]}, \"synonyms\":{}}");

	add("hypernaturalism", "{\"term\":\"hypernaturalism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An extreme form of naturalism\", \"priority\":1}]}, \"synonyms\":{}}");

	add("hypernoea", "{\"term\":\"hypernoea\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) over + breath.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"abnormal breathing, due to slightly deficient arterialization of the blood\", \"priority\":1}]}, \"synonyms\":{}}");

	add("hypernucleus", "{\"term\":\"hypernucleus\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|hyper|nucleus|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a nucleus that consists of protons, neutrons and at least one hyperon, such as a lambda baryon\", \"priority\":1}]}, \"synonyms\":{}}");

	add("hyperonym", "{\"term\":\"hyperonym\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|hyper|onym|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Hypernym; superordinate term\", \"priority\":1}]}, \"synonyms\":{}}");

	add("hyperoodon", "{\"term\":\"hyperoodon\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"multiple languages\"], \"text\":\"From Multiple languages \u0027hyperoodon\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A whale in the genus \u0027Hyperoodon\u0027 of the order Cetacea, comprising both species of bottlenose whale\", \"priority\":1}]}, \"synonyms\":{}}");

	add("hyperosmia", "{\"term\":\"hyperosmia\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Hypersensitivity of the sense of smell\", \"priority\":1}]}, \"synonyms\":{}}");

	add("hyperosmolarity", "{\"term\":\"hyperosmolarity\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|hyper|osmolarity|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An abnormally high osmolarity\", \"priority\":1}]}, \"synonyms\":{}}");

	add("hyperostosis", "{\"term\":\"hyperostosis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|hyper|ostosis|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An excessive growth or thickening of bone\", \"priority\":1}]}, \"synonyms\":{}}");

