	add("hypersensitivity", "{\"term\":\"hypersensitivity\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|hyper|sensitivity|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"any heightened immune response to an antigen; an allerg\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"the state of being easily offended or hur\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2015\u0027\u0027, The Atlantic, G. Lukianoff and J. Haidt, \u0027[http://www.theatlantic.com/magazine/archive/2015/09/the-coddling-of-the-american-mind/399356/ The Coddling of the American Mind\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"If our universities are teaching students that their emotions can be used effectively as weapons—or at least as evidence in administrative proceedings—then they are teaching students to nurture a kind of \u0027\u0027hypersensitivity\u0027\u0027 that will lead them into countless drawn-out conflicts in college and beyond\", \"priority\":4}]}, \"synonyms\":{}}");

