	add("hypertext", "{\"term\":\"hypertext\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|hyper|text|lang\u003den}}; coined by w:Ted Nelson|Ted Nelson circa 1965.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Digital text in which the reader may navigate related information through embedded hyperlinks\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Christian Vandendorpe, Phyllis Aronoff, and Howard Scott (Phyllis Aronoff, Howard Scott, transl.), \u0027From Papyrus to Hypertext: Toward the Universal Digital Library\u0027, University of Illinois Press, ISBN 0252076257, p 1\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"We do not read \u0027\u0027hypertext\u0027\u0027 the same way we read a novel, and browsing the Web is a different experience from reading a book or newspaper\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, Ray McAleese, \u0027Hypertext: Theory into Practice\u0027, Intellect Books, ISBN 9781871516289, [http://books.google.com/books?id\u003dZ3rD8vVS2mAC\u0026amp;printsec\u003dfrontcove\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"PPA2,M1 p 2\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Further, \u0027\u0027hypertext\u0027\u0027 systems, because of their ease of construction, are very rich in text, graphics and visual illustrations\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027, Gary Wolf, \u0026quot;The Curse of Xanadu\u0026quot;, [http://www.wired.com/wired/archive/3.06/xanadu.html?pg\u003d9\u0026amp;topic\u003d WIRED\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Did Nelson realize at the time that he had met Xanadu\u0027s second parent? Probably not. The inventor scattered his ideas as widely as possible, with little care about where they landed. But as the decades passed, it would be Gregory who oversaw the attempt to transform Xanadu into a real product. He never received much public notice, but through all the project\u0027s painful deaths and rebirths, Gregory\u0027s commitment to Nelson\u0027s dream of a universal \u0027\u0027hypertext\u0027\u0027 library never waned. If Ted Nelson is Xanadu\u0027s profligate father, Roger Gregory is Xanadu\u0027s devoted mother, and in retrospect, his role appears to have been intertwined with a terrible element of sacrifice\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A hypertext document\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1969\u0027\u0027, S. Carmody, W. Gross, T. Nelson, D. Rice, and A. van Dam, “A Hypertext Editing System for the /360”, in Michael Faiman and Jurg Nievergelt, \u0027Pertinent Concepts in Computer Graphics: Proceedings\u0027, University of Illinois Press, p 296\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A \u0027\u0027hypertext\u0027\u0027 system, then, is a memex-like device for creating and manipulating \u0027\u0027hypertexts\u0027\u0027, both for on-line browsing, and for reducing selected portions of such texts to . \", \"priority\":11}]}, \"synonyms\":{}}");

	add("hypertexture", "{\"term\":\"hypertexture\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|hyper|texture|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A realistic simulated surface texture produced by adding small distortions across the surface of an object\", \"priority\":1}]}, \"synonyms\":{}}");

	add("hyperthymesia", "{\"term\":\"hyperthymesia\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) (\u0026quot;excessive remembering\u0026quot;).{{etystub|en}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A rare condition in which an individual possesses a superior autobiographical memory and is able to recall the vast majority of personal experiences and events in his or her life\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Mikita Brottman, \u0027The Solitary Vice: Against Reading\u0027, [http://books.google.com.au/books?id\u003dKQHhAAAAMAAJ\u0026amp;q\u003d%22hyperthymesia%22%7C%22hyperthymesias%22\u0026amp;dq\u003d%22hyperthymesia%22%7C%22hyperthymesias%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dU3c5U6XYK8THkwWQ64HIBg\u0026amp;redir_esc\u003dy page 160\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Others may have some degree of \u0027\u0027hyperthymesia\u0027\u0027 — they may spend an abnormally large amount of time thinking about their personal past, and have an extraordinary capacity to recall specific events in detail\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, w:Marilu Marilu Henner, \u0027Total Memory Makeover: Uncover Your Past, Take Charge of Your Future\u0027, [http://books.google.com.au/books?id\u003dLCPiLFodRHMC\u0026amp;pg\u003dPA4008\u0026amp;dq\u003d%22hyperthymesia%22%7C%22hyperthymesias%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dU3c5U6XYK8THkwWQ64HIBg\u0026amp;redir_esc\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22hyperthymesia%22%7C%22hyperthymesias%22\u0026amp;f\u003dfalse page 8\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Lesley hadn\u0027t been interested in the story, because she didn\u0027t think that HSAM (or \u0027\u0027hyperthymesia\u0027\u0027, as it was called then) was that rare, having known me for so many years\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, Annette Kujawski Taylor, \u0027Hyperthymesia\u0027, Annette Kujawski Taylor (editor), \u0027Encyclopedia of Human Memory\u0027, [http://books.google.com.au/books?id\u003dVevXAQAAQBAJ\u0026amp;pg\u003dPA548\u0026amp;dq\u003d%22hyperthymesia%22%7C%22hyperthymesias%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dy3E5U46sDca9kAWpyoCwAQ\u0026amp;redir_esc\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22hyperthymesia%22%7C%22hyperthymesias%22\u0026amp;f\u003dfalse page 547\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Hyperthymesia\u0027\u0027 is also known as \u0027\u0027superior autobiographical memory\u0027\u0027. People either have it or they do not, and there are no more than 20 documented cases of people known to have \u0027\u0027hyperthymesia\u0027\u0027.Most people diagnosed with \u0027\u0027hyperthymesia\u0027\u0027 can remember minute details of events from any given day in their past lives, sometimes beginning with puberty but often going back to early childhood\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, Deepak Chopra, Rudolph E. Tanzi, \u0027Super Brain: Unleash the Explosive Power of Your Mind \u0027, [http://books.google.com.au/books?id\u003daWI1AAAAQBAJ\u0026amp;pg\u003dPA46\u0026amp;dq\u003d%22hyperthymesia%22%7C%22hyperthymesias%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dU3c5U6XYK8THkwWQ64HIBg\u0026amp;redir_esc\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22hyperthymesia%22%7C%22hyperthymesias%22\u0026amp;f\u003dfalse page 46\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"We discussed memory in the previous chapter of this book, and \u0027\u0027hyperthymesia\u0027\u0027 is the ultimate example of an ability that everyone shares being carried to superhuman lengths—only, it\u0027s very human still\", \"priority\":12}]}, \"synonyms\":{}}");

