	add("hypertrophy", "{\"term\":\"hypertrophy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{confix|hyper|trophy|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An increase in the size of an organ due to swelling of the individual cell\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Increase in muscle size through increased size of individual muscle cells; a result of weightlifting, and other exercise. It differs from muscle hyperplasia, which is the formation of new muscle cells\", \"priority\":2}]}, \"synonyms\":{}}");

