	add("hypocorism", "{\"term\":\"hypocorism\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"\u0027hypocorisma\u0027 a loan from Ancient greek (to 1453) noun \u0027ὑποκόρισμα\u0027 from the verb \u0027ὑποκορίζομαι\u0027 (to talk in a childish manner) The Ancient greek (to 1453) verb \u0027ὑποκορίζομαι\u0027 is compounded from \u0027ὑπό|lang\u003dgrc\u0027 () + \u0027κορίζομαι|lang\u003dgrc\u0027 () In the verb you can see the word \u0027κόρος|lang\u003dgrc\u0027 () or \u0027κόρη|lang\u003dgrc\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A term of endearment; a pet name\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Baby-talk, e.g. \u0027bow-wow\u0027 for \u0027dog\u0027, \u0027choo-choo\u0027 for \u0027train\", \"priority\":2}]}, \"synonyms\":{}}");

