	add("hypodiastole", "{\"term\":\"hypodiastole\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Latin \u0027hypodiastolē\u0027 from Ancient greek (to 1453) {{m|grc|ὑποδιαστολή}}, from {{m|grc|ὑπό||under, lower}} + {{m|grc|διαστολή||separation, distinction}}, from {{m|grc|διαστέλλω||separate}}, from {{m|grc|διά||through, during}} + {{m|grc|στέλλω||order, arrange}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A mark ⟨⟩ in late Classical Classical and Byzantine Greek used as a form of interpunct to show two words should be read separately in situations where they might otherwise be confused with an identically spelled single word\", \"priority\":1}]}, \"synonyms\":{}}");

