	add("hyposensitization", "{\"term\":\"hyposensitization\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A form of immunotherapy in which the patient is vaccinated with progressively larger doses of an allergen to which they have been diagnosed as being sensitive\", \"priority\":1}]}, \"synonyms\":{}}");

