	add("hypostasis", "{\"term\":\"hypostasis\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From ecclesiastical Latin \u0027hypostasis\u0027 from Ancient greek (to 1453) \u0027ὑπόστασις\u0027 (sediment, foundation; substance, existence, essence) from \u0027ὑπό\u0027 + \u0027στάσις\u0027 (standing)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A sedimentary deposit, especially in urine\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1588\u0027\u0027, Christopher Marlowe, \u0027Tamburlaine the Great\u0027, V.3\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Physician: I have viewed your urine, and the \u0027\u0027hypostasis\u0027\u0027, / Thick and obscure, doth make the danger great\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The essential person, specifically the single person of Christ (as distinguished from his two ‘natures’, human and divine), or of the three ‘persons’ of the Trinity (comprising a single ‘essence’\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1985\u0027\u0027, Anthony Burgess, \u0027Kingdom of the Wicked\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"What did the God who hammered the universe together have to do with virtue, redemption, the strange doctrine of \u0027\u0027hypostasis\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Karen Armstrong, \u0027The Battle for God\u0027, Harper 2004, p. 69\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"As Gregory of Nyssa had explained, the three \u0027\u0027\u0027hypostases\u0027\u0027\u0027 of Father, Son, and Spirit were not objective facts but simply “terms that we use” to express the way in which the “unnameable and unspeakable” divine nature (\u0027ousia\u0027) adapts itself to the limitations of our human minds\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, \u0027A History of Christianity\u0027, Penguin 2010, p. 218\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"As a result of this verbal pact, the Trinity consists of three equal \u0027\u0027\u0027hypostaseis\u0027\u0027\u0027 in one \u0027ousia\u0027: three equal Persons (Father, Son, Holy Spirit) sharing one Essence or Substance (Trinity or Godhead\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The underlying reality or substance of something\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"1975\u0027\u0027, Mary Boyce, \u0027History of Zoroastrianism\u0027, vol. I, Brill 1975, p. 59\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Rašnu, the \u0026quot;Judge\u0026quot;, appears to be the \u0027\u0027hypostasis\u0027\u0027 of the idea embodied in the common noun \u0027rašnu\u0027, \u0026quot;judging, one who judges\u0026quot\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, John Gregory (ed.), \u0027The Neoplatonists: A Reader\u0027, p. 13\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"The One, Intellect and Soul, then, are the three transcendent sources – or \u0027\u0027hypostases\u0027\u0027 – of existence\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, George E. Karamanolis, \u0027Plato and Aristotle in agreement?\u0027, p. 320\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"as far as we know, Porphyry did not consider the divine intellect to be a \u0027\u0027\u0027hypostasis\u0027\u0027\u0027 clearly distinct from the Soul, but he often designated it ‘hypercosmic soul’\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"The effect of one gene preventing another from expressing\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"1997\u0027\u0027, Vogul \u0026amp; Motulsky, \u0027Human Genetics: Problems and Approaches\u0027, p. 141\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"When penetrance is suppressed altogether, the term ‘epistasis’ (and ‘\u0027\u0027hypostasis\u0027\u0027’ of the suppressed gene) is used\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"Postmortem lividity; livor mortis; suggillation\", \"priority\":21}]}, \"synonyms\":{}}");

