	add("hypotheses", "{\"term\":\"hypotheses\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Category:English irregular plurals ending in \u0026quot;-es\u0026quot\", \"priority\":1}]}, \"synonyms\":{}}");

	add("hypothesis", "{\"term\":\"hypothesis\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"ancient greek (to 1453)\"], \"text\":\"Recorded since 1596, from Middle french (ca. 1400-1600) \u0027hypothese\u0027 from \u0027hypothesis\u0027 from Ancient greek (to 1453) \u0027ὑπόθεσις\u0027 (base, basis of an argument, supposition) literally “a placing under”, itself from \u0027ὑποτίθημι\u0027 (i set before, suggest) from \u0027ὑπό\u0027 (below) + \u0027τίθημι\u0027 (i put, place)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Used loosely, a tentative conjecture explaining an observation, phenomenon or scientific problem that can be tested by further observation, investigation and/or experimentation. As a scientific term of art, see the attached quotation. Compare to theory, and quotation given there\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Ronald H. Pine, http://www.csicop.org/specialarticles/show/intelligent_design_or_no_model_creationism, 15 October 2005\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Far too many of us have been taught in school that a scientist, in the course of trying to figure something out, will first come up with a \u0026quot;hypothesis\u0026quot; (a guess or surmise—not necessarily even an \u0026quot;educated\u0026quot; guess). ... [But t]he word \u0026quot;hypothesis\u0026quot; should be used, in science, exclusively for a \u0027reasoned, sensible, knowledge-informed explanation\u0027 for why some phenomenon exists or occurs. An hypothesis can be as yet untested; can have already been tested; may have been falsified; may have not yet been falsified, although tested; or may have been tested in a myriad of ways countless times without being falsified; and it may come to be universally accepted by the scientific community. An understanding of the word \u0026quot;hypothesis,\u0026quot; as used in science, requires a grasp of the principles underlying Occam\u0027s Razor and Karl Popper\u0027s thought in regard to \u0026quot;falsifiability\u0026quot;—including the notion that any respectable scientific hypothesis must, in principle, be \u0026quot;capable of\u0026quot; being proven wrong (if it should, in fact, just happen to be wrong), but none can ever be proved to be true. One aspect of a proper understanding of the word \u0026quot;hypothesis,\u0026quot; as used in science, is that only a vanishingly small percentage of hypotheses could ever potentially become a theory\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An assumption taken to be true for the purpose of argument or investigation\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The antecedent of a conditional statement\", \"priority\":5}]}, \"synonyms\":{}}");

	add("hypothyroidism", "{\"term\":\"hypothyroidism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Coined some time between 1900 and 1905 from the prefix \u0026quot;hypo-\u0026quot; (meaning \u0026quot;under), the word \u0026quot;thyroid,\u0026quot; and the suffix \u0026quot;-ism\u0026quot; (meaning \u0026quot;a system of\u0026quot;).\u0026lt;ref\u0026gt;[http://dictionary.reference.com/browse/hypothyroidism Hypothyroidism at Dictionary.com]\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The disease state caused by insufficient production of thyroid hormone by the thyroid gland\", \"priority\":1}]}, \"synonyms\":{}}");

	add("hypotrochoid", "{\"term\":\"hypotrochoid\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|hypo|trochoid|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A geometric curve traced by a fixed point on the radius line outside one circle which rotates inside the perimeter of another circle\", \"priority\":1}]}, \"synonyms\":{}}");

